    <div class="box" id="box">
      <button onclick="run()">Add</button>

      <div class="bubble-new">
        <div class="bubble-new-bubble"></div>
        <div class="bubble-name">
          <p class="name">Sumanth Ale.</p>
        </div>
      </div>
    </div>

    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.6.3/jquery.min.js"></script>
    <script>
      var myAudio = new Audio("./bubbles.mp3");
      myAudio.play();
      myAudio.addEventListener(
        "ended",
        function () {
          this.currentTime = 0;
          this.play();
        },
        false
      );

      function run() {
        const random = Math.floor(Math.random() * 1000);

        new Audio("./bubble.mp3").play();
        $("#box").append(`
      <div class="bubble start" id="bubble-${random}">
      <div class="bg"></div>
      
    </div>
      `);
        setTimeout(() => {
          createBubble(random);
        }, 4000);
      }

      function createBubble(random) {
        const randomX = Math.floor(Math.random() * 85);
        const randomY = Math.floor(Math.random() * 85);

        $(`#bubble-${random}`).remove();
        $("#box").append(`
      <div class="animate__animated bubble-new" id="anime" style="
    top: ${randomX}%;
    left: ${randomY}%;
">
        <div class="bubble-new-bubble"></div>
         <div class="bubble-name">
          <p class="name">Sumanth Ale.</p>
        </div>
    </div>
      `);
        $(".bubble").click(function () {
          $(this).css("animation-name", "rubberBand");
          $(this).css("animation-duration", "1s");
          $(this).css("animation-iteration-count", "initial");
        });
      }
    </script>
